export default class DefaultTree {
    constructor() {
        this.name = 'NULL';
        this.key  = null;
    }

    performOperation(operation) {
        return operation;
    }

    preRender(operation) {
        return operation;
    }
    
    postRender(operation) {
        return operation;
    }

    getScaleFactor() {
        return 1;
    }

    Tree() {
        return null;
    }
}
